import React from 'react'
import Card from './components/Card'
import Header from '../../components/Header'
import Footer from '../../components/Footer'
import * as productList from './data/productList.json';

import './overview.scss'

const Overview = () => {
    const products = productList.default;

    return (
        <>
            <Header/>
            <a href='/'>Home</a>

            <h2>Product Overview page</h2>

            <div className="product-overview-page">
                {products.map(function (product, index) {
                    if (products[index].isEnabled && products[index].SKU) {
                        return <Card key={index} productInfo={products[index]}/>;
                    }
                })}
            </div>

            <Footer/>
        </>
    )
}

export default Overview
